{'publishedAt': '2022-11-25T11:03:39Z', 'channelId': 'UC8hGUtfEgvvnp6IaHSAg1OQ', 'title': 'SAÚDE / ESPORTE / ECONOMIA / EDUCAÇÃO: a edição 2022 dos Jogos Escolares Brasileiros chegou ao fim.', 'description': "Depois de 12 dias de sorrisos, choros, emoções e abraços, a edição 2022 dos Jogos Escolares Brasileiros chegou ao fim. A festa do esporte escolar teve número igual de participantes por Unidade Federativa e contou com a equidade de gênero na formação das equipes, com 2.839 meninas e 2.819 meninos, com faixa etária de 12 a 14 anos, nas 17 modalidades em disputa.

A competição teve números impressionantes. A maioria das provas das 17 modalidades teve transmissão ao vivo pelo canal da Confederação Brasileira de Desporto Escolar (CBDE) no Youtube. Para melhor atender os estudantes, o evento contou com mais de 16 mil passagens aéreas emitidas, de ida e de volta, custeadas pelo Ministério da Cidadania. Mais de 150 mil refeições distribuídas e houve mais de 63 mil diárias em hotéis, impulsionando a economia local.\xa0

No Rio de Janeiro, os milhares de estudantes competiram em quatro locais: Parque Olímpico da Barra, Complexo Olímpico de Deodoro, Parque Aquático Júlio Delamare e UNIFA. Os JEB's contaram com 493 cerimônias de premiação, com a distribuição de 3.354 medalhas para jovens de todo o país.", 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/YjNtykE-doI/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/YjNtykE-doI/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/YjNtykE-doI/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/YjNtykE-doI/sddefault.jpg', 'width': 640, 'height': 480}}, 'channelTitle': 'Jair Bolsonaro', 'playlistId': 'UU8hGUtfEgvvnp6IaHSAg1OQ', 'position': 110, 'resourceId': {'kind': 'youtube#video', 'videoId': 'YjNtykE-doI'}, 'videoOwnerChannelTitle': 'Jair Bolsonaro', 'videoOwnerChannelId': 'UC8hGUtfEgvvnp6IaHSAg1OQ'}

